import React from 'react';
import {
  AppBar,
  Toolbar,
  Typography,
  Button,
  Box,
  Container
} from '@mui/material';
import { Link, useNavigate } from 'react-router-dom';

const AppHeader = () => {
  const navigate = useNavigate();

  const handleNavigation = (path) => {
    // –ü–ª–∞–≤–Ω–∞—è –ø—Ä–æ–∫—Ä—É—Ç–∫–∞ –≤–≤–µ—Ä—Ö –ø–µ—Ä–µ–¥ –ø–µ—Ä–µ—Ö–æ–¥–æ–º
    window.scrollTo({
      top: 0,
      behavior: 'smooth'
    });
    // –ù–µ–±–æ–ª—å—à–∞—è –∑–∞–¥–µ—Ä–∂–∫–∞ –¥–ª—è –ø–ª–∞–≤–Ω–æ—Å—Ç–∏
    setTimeout(() => {
      navigate(path);
    }, 200);
  };

  return (
    <AppBar 
      position="sticky"
      elevation={0}
      style={{ 
        background: 'rgba(255, 255, 255, 0.95)',
        backdropFilter: 'blur(20px)',
        boxShadow: '0 8px 32px rgba(0,0,0,0.1)',
        borderBottom: '1px solid rgba(255,255,255,0.2)'
      }}
    >
      <Container maxWidth="xl">
        <Toolbar style={{ justifyContent: 'space-between', padding: '12px 0' }}>
          <Typography
            variant="h4"
            component={Link}
            to="/"
            style={{
              fontWeight: 800,
              textDecoration: 'none',
              background: 'linear-gradient(135deg, #10B981 0%, #3B82F6 100%)',
              WebkitBackgroundClip: 'text',
              WebkitTextFillColor: 'transparent',
              backgroundClip: 'text',
              display: 'flex',
              alignItems: 'center',
              gap: '8px',
              fontSize: '1.75rem',
              transition: 'all 0.3s ease',
              '&:hover': {
                transform: 'scale(1.05)',
              }
            }}
            sx={{
              '&:hover': {
                transform: 'scale(1.05)',
              }
            }}
          >
            üå± NutriPlanner
          </Typography>

          <Box style={{ display: 'flex', gap: '8px', alignItems: 'center', flexWrap: 'wrap' }}>
            <Button 
              onClick={() => handleNavigation('/generator')}
              variant="contained"
              style={{ 
                background: 'linear-gradient(135deg, #10B981 0%, #059669 100%)',
                color: 'white',
                fontWeight: 600,
                borderRadius: '12px',
                padding: '8px 20px',
                boxShadow: '0 4px 14px rgba(16, 185, 129, 0.3)',
                transition: 'all 0.4s cubic-bezier(0.4, 0, 0.2, 1)'
              }}
              sx={{
                '&:hover': {
                  transform: 'translateY(-2px)',
                  boxShadow: '0 8px 20px rgba(16, 185, 129, 0.4)',
                }
              }}
            >
              –°–æ–∑–¥–∞—Ç—å —Ä–∞—Ü–∏–æ–Ω
            </Button>
            <Button 
              onClick={() => handleNavigation('/plans')}
              style={{ 
                color: '#374151',
                fontWeight: 500,
                borderRadius: '12px',
                padding: '8px 16px',
                transition: 'all 0.4s cubic-bezier(0.4, 0, 0.2, 1)'
              }}
              sx={{
                '&:hover': {
                  background: 'rgba(16, 185, 129, 0.1)',
                  color: '#10B981',
                  transform: 'translateY(-2px)',
                }
              }}
            >
              –ú–æ–∏ –ø–ª–∞–Ω—ã
            </Button>
            <Button 
              onClick={() => handleNavigation('/progress')}
              style={{ 
                color: '#374151',
                fontWeight: 500,
                borderRadius: '12px',
                padding: '8px 16px',
                transition: 'all 0.4s cubic-bezier(0.4, 0, 0.2, 1)'
              }}
              sx={{
                '&:hover': {
                  background: 'rgba(16, 185, 129, 0.1)',
                  color: '#10B981',
                  transform: 'translateY(-2px)',
                }
              }}
            >
              –ü—Ä–æ–≥—Ä–µ—Å—Å
            </Button>
            <Button 
              onClick={() => handleNavigation('/profile')}
              style={{ 
                color: '#374151',
                fontWeight: 500,
                borderRadius: '12px',
                padding: '8px 16px',
                transition: 'all 0.4s cubic-bezier(0.4, 0, 0.2, 1)'
              }}
              sx={{
                '&:hover': {
                  background: 'rgba(16, 185, 129, 0.1)',
                  color: '#10B981',
                  transform: 'translateY(-2px)',
                }
              }}
            >
              –ü—Ä–æ—Ñ–∏–ª—å
            </Button>
            <Button 
              onClick={() => handleNavigation('/recipe-generator')}
              style={{ 
                color: '#374151',
                fontWeight: 500,
                borderRadius: '12px',
                padding: '8px 16px',
                transition: 'all 0.4s cubic-bezier(0.4, 0, 0.2, 1)'
              }}
              sx={{
                '&:hover': {
                  background: 'rgba(16, 185, 129, 0.1)',
                  color: '#10B981',
                  transform: 'translateY(-2px)',
                }
              }}
            >
              –†–µ—Ü–µ–ø—Ç—ã
            </Button>
            <Button 
              onClick={() => handleNavigation('/seasonal-menu')}
              style={{ 
                color: '#374151',
                fontWeight: 500,
                borderRadius: '12px',
                padding: '8px 16px',
                transition: 'all 0.4s cubic-bezier(0.4, 0, 0.2, 1)'
              }}
              sx={{
                '&:hover': {
                  background: 'rgba(16, 185, 129, 0.1)',
                  color: '#10B981',
                  transform: 'translateY(-2px)',
                }
              }}
            >
              –°–µ–∑–æ–Ω—ã
            </Button>
            <Button 
              onClick={() => handleNavigation('/login')}
              variant="outlined"
              style={{ 
                borderColor: '#10B981',
                color: '#10B981',
                fontWeight: 600,
                borderRadius: '12px',
                padding: '8px 20px',
                transition: 'all 0.4s cubic-bezier(0.4, 0, 0.2, 1)'
              }}
              sx={{
                '&:hover': {
                  background: '#10B981',
                  color: 'white',
                  transform: 'translateY(-2px)',
                  boxShadow: '0 4px 14px rgba(16, 185, 129, 0.3)',
                }
              }}
            >
              –í–æ–π—Ç–∏
            </Button>
          </Box>
        </Toolbar>
      </Container>
    </AppBar>
  );
};

export default AppHeader;
